import React from 'react';
import { Link, useNavigate } from 'react-router-dom';
import child_home from '../images_home/child_home.png';

import '../style.css';
function Home() {
    let navigate = useNavigate();
    return (
        <div className='container'>
            <div className='card shadow parent'>
                <div className='bg-green col-10'>

                    <ul className='d-flex list-unstyled'>
                        <li className='me-3'>
                            <Link to="/" className='text-light'>About</Link>
                        </li>
                        <li className='me-3'>
                            <Link to="/">Score</Link>
                        </li>
                        <li>
                            <Link to="/">Language</Link>
                        </li>
                    </ul>
                </div>
                <img style={{ width: "100%" }} src={child_home} alt='child_home'></img>
            </div>


        </div>
    )
}

export default Home;
